//package codechef;Â import java.util.*;import java.io.*;public class CodeChef{    public static long arr_max(long arr[])    {        long max = 0;        for(int i = 0; i<arr.length; i++)        {            if(arr[i]>max) max = arr[i];        }        return max;    }    public static int gcd(int a,int b)    {        if(b==0) return a;        return gcd(b,a%b);    }    public static int fact(int n)    {        int fact = 1;        for(int i = 1; i<=n; i++) fact*=i;        return fact;    }    public static boolean isPrime(int n)    {        if(n==2) return true;        else if(n%2==0) return false;        for(int i = 2; i<=Math.sqrt(n); i++)        {            if(n%i==0)            {                return false;            }        }        return true;    }    public static void main(String[] args)throws IOException    {        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));        int t = Integer.parseInt(br.readLine());        while(t-->0)        {            String s[] = br.readLine().split(" ");        int a = Integer.parseInt(s[0]), b = Integer.parseInt(s[1]), c = Integer.parseInt(s[2]), d = Integer.parseInt(s[3]), k = Integer.parseInt(s[4]);        int pen = 0, pencil = 0;        if(a%c==0)        {            pen = a/c;        }        else pen = a/c + 1;        if(b%d==0) pencil = b/d;        else pencil = b/d + 1;        if(pen+pencil<=k) System.out.println(pen+" "+pencil);        else System.out.println("-1");        }            }}
